export function getCompany(){
    const company = [
        {
            code : '01',
            name : '마이체크업'
        },
        {
            code : '02',
            name : '벨류맵'
        }
    ];

    return company;
}
export function getCode(type : string){
    const company = [
        {
            type : '01',
            code : '1',
            name : '마이체크업'
        },
        {
            type : '02',
            code : '02',
            name : '벨류맵'
        }
    ];

    for(let idx of company){
        if(idx.type === type) return idx.code;
    }
    return '00';
}

export default {getCompany};
